/**
* Realiza la peticion a coppel
* @returns
*/
function ejecutaWebService(peticion){
	    console.log("PETICION COPPEL");
		soapData 	= "",
		httpObject 	= null,
		docXml 		= null,
		iEstado 	= 0,
		sMensaje 	= "";
		sUrlSoap 	= peticion.urlSoap.replace("tps", "tp");
		
		console.log("URL: "+sUrlSoap);
		var resultado = "";

		//Cadena para la ejecuci�n de la aplicaci�n
		soapData=peticion.soapData;
		soapData= remplazar(soapData, "tps", "tp")

		console.log("peticion: "+soapData);
		
		//Objeto para la peticion
		httpObject = getHTTPObject();
		console.log("httpObject: "+httpObject);
		if(httpObject){
			if(httpObject.overrideMimeType)
				httpObject.overrideMimeType("false");
  		    console.log("Invocando: "+sUrlSoap);
			httpObject.open('POST', sUrlSoap, false); //-- no asincrono
			httpObject.setRequestHeader("Accept-Language", null);
			httpObject.onreadystatechange=function(){
				if(httpObject.readyState == 4 && httpObject.status == 200){
					parser = new DOMParser();
					docXml = parser.parseFromString(httpObject.responseText, "text/xml");
					iEstado = docXml.getElementsByTagName('Estado')[0].childNodes[0].nodeValue;
					if(iEstado ==1){
						resultado = docXml.getElementsByTagName('DescripcionEstado')[0].childNodes[0].nodeValue;
							
					}else if(iEstado == -1){
						document.getElementById('tituloError').innerHTML = "ERROR";
						document.getElementById('mensajeErrorModal').innerHTML = "CANCELACI\u00D3N EN LA TOMA DE FIRMA";
						window.location.href = "#errorModal";		
					}else {
						document.getElementById('tituloError').innerHTML = "ERROR";
						document.getElementById('mensajeErrorModal').innerHTML = "SE PRESENT\u00D3 UN ERROR EN EL DISPOSITIVO PARA LA TOMA DE FIRMA FAVOR DE REPORTARLO";
						window.location.href = "#errorModal";
					}
				}
				else{
					console.log(httpObject.status);
				}
			};
			httpObject.send(soapData);
		}
		console.log("resultado2: "+resultado);
		regresoPad(resultado);
	
}

//Obtiene el objeto de peticion
function getHTTPObject(){
    var xhr = false;
    if (window.ActiveXObject) {
        try {
            xhr = new ActiveXObject("Msxml2.XMLHTTP");
        } catch(e) {
            try {
                xhr = new ActiveXObject("Microsoft.XMLHTTP");
            } catch(e) {
               console.log("Error ActiveXObject: "+e);
                xhr = false;
            }
        }
    } else if (window.XMLHttpRequest) {
        try {
            xhr = new XMLHttpRequest();
        } catch(e) {
            console.log("Error XMLHttpRequest: "+e);
            xhr = false;
        }
    }
    return xhr;
}

/**
 * Remplaza la cadena
 * @param cadena
 * @param cadenaBuscar
 * @param valor
 * @returns
 */
function remplazar(cadena,cadenaBuscar,valor){
	
	while(cadena.search(cadenaBuscar) != -1){
		cadena = cadena.replace(cadenaBuscar,valor);
	}
	
	return cadena;
}